import { BasicResumeNode } from "../utility/NodeTree";
import Column from "../Column";
import Header, { BasicHeaderProps } from "../Header";
import CssNode from "../utility/CssTree";
import Section from "../Section";
import Entry, { BasicEntryProps } from "../Entry";
import RichText from "../RichText";
import getDefaultCss, { getRootCss } from "./CssTemplates";
import Grid from "../Grid";
import { makeList } from "./TemplateHelper";

const headshot = `<img src=\"data:image/png;base64,\">`;

export function randyMarshCss() {
    let randyCss = getDefaultCss().setProperties([
        ["font-family", "var(--sans-serif)"],
        ["font-size", "11pt"],
        ["display", "grid"],
        ["grid-template-columns", "250px 1fr"],
        ["height", "100%"]
    ]);

    /** Headshot */
    randyCss.add(
        '#headshot', {
            'height': 'var(--header-height)',
            'text-align': 'center',
            'padding-bottom': 'var(--header-padding-bottom)'
        }).add('Image', { 'border-radius': '50%' }, 'img');

    /** Header */
    randyCss.mustFindNode("Header").setProperties([
        ["height", "var(--header-height)"],
        ["font-family", "var(--serif)"],
        ["text-transform", "uppercase"],
        ["color", "var(--text-color)"],
        ['padding-bottom', 'var(--header-padding-bottom)']
    ]).setProperties([
        ["font-size", "13pt"],
        ["text-transform", "initial"]
    ], ["Title Group", "Subtitle"]);

    /** Section CSS */
    randyCss.mustFindNode('Section').setProperties(
        [['margin-top', 'var(--spacing)']], 'Content'
        ).setProperties([
            ["font-family", "var(--sans-serif)"],
            ["font-weight", "bold"],
            ["font-size", "20pt"],
            ["color", "var(--randy-teal)"]
            ], 'Title'
            ).add('Grid', {
                'grid-template-columns': 'var(--year-column-width) 1fr'
            }, 'div.grid-container'
            ).add('Entry', {
                'border-left': '1px solid var(--text-color)',
                'padding-left': 'var(--large-spacing)',
            }, 'div.entry');

    /** Entry CSS */
    randyCss.mustFindNode("Entry").setProperties(
        [['padding-bottom', 'var(--large-spacing)']]
    ).mustFindNode("Title Block").setProperties([
            ["font-weight", "bold"],
            ["font-family", "var(--serif)"]
        ], ["Title", "First Title Field"]
        ).setProperties([["font-weight", "normal"]], ["Title", "Other Title Fields"]
        ).mustFindNode(["Subtitle", "Last Field"]).add('::before', {
            "content": '"\\1f33f"',
            "padding": "var(--spacing)"
        });

    /** Columns */
    randyCss.addNode(
        (randyCss.findNode("Column") as CssNode).copySkeleton('#main-column', '#main-column')
    ).setProperties([["padding", "0.5in"]]);

    randyCss.addNode(
        (randyCss.findNode("Column") as CssNode).copySkeleton('#sidebar', '#sidebar')
    ).setProperties([
        ["color", "var(--text-color)"],
        ["padding", "0.5in"],
        ["background", "var(--secondary-color)"]
    ]).add('Heading', { 'color': 'var(--text-color)' }, 'h2');

    randyCss.addNode(
        (randyCss.findNode("Rich Text") as CssNode).copySkeleton('#tegridy', '#tegridy')
    ).setProperties([
        ["margin-top", "auto"],
        ["text-align", "right"]]);

    return randyCss;
}

export function randyMarshRootCss(): CssNode {
    let root = getRootCss();
    if (root) {
        root.properties.set('--header-base-height', '120px');
        root.properties.set('--header-padding-bottom', 'var(--large-spacing)');
        root.properties.set('--header-height', 'calc(var(--header-base-height) - var(--header-padding-bottom))');
        root.properties.set('--year-column-width', '100px');
        root.properties.set('--text-color', '#43353f');
        root.properties.set('--randy-teal', '#4eb3b9');
        root.properties.set('--secondary-color', '#fbdcb6');
    }

    return root;
}

